import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
export const Strap1=()=>{
    return(
        <>
            <p className="text-danger">Zealous Tech Corp</p>
            <p className="text-primary">Zealous Tech Corp</p>
            <p className="text-success">Zealous Tech Corp</p>
            <p className="text-warning">Zealous Tech Corp</p>
        </>
    )
}
